from typing import List, Dict, Tuple, TypeVar, Any, Callable, Union
import csv
import os
import numpy as np
import pandas as pd
from tabulate import tabulate


class Writer:
    """recive a list of tuples List[Tuple(List, List), Tuple(List, List)]"""
    A = TypeVar("A", List, np.ndarray)
    def __init__(self, raw_data:A) -> None:
        coll_r, coll_l = self._separate_collision_rl(raw_data)
        self.collision_r: pd.DataFrame = self._convert_to_dataframe(coll_r)
        self.collision_l: pd.DataFrame = self._convert_to_dataframe(coll_l)

    def __repr__(self) -> Tuple:
        return self.collision_r, self.collision_l

    def _separate_collision_rl(self, collision) -> Tuple[List,List]:
        """separate the tuples lists coll_right and coll_left making a list of list just for coll_right and another for coll_left"""
        collision_right: List = []
        collision_left: List = []
        for tuples in collision:
            collision_right.append(tuples[0])
            collision_left.append(tuples[1])

        return collision_right, collision_left

    def _convert_to_dataframe(self, data: List) -> pd.DataFrame:
        """takes a list of lists and transforms it to a dataframe """
        return pd.DataFrame(data, index=[x for x in range(len(data))])

    def export_dataframe(self, filename: str, filename2:str, export_format: str = "", mode: str ="w") -> None:
        """takes several arguments incl. data which is just the instance class defined obove"""
        if(export_format == "csv"):
            self.collision_r.to_csv(filename, mode=mode, float_format='%.2f')
            print("----------------collision right data is successfully exported-------------")
            self.collision_l.to_csv(filename2, mode=mode, float_format="%.2f")
            print("---------------collision left data is successfully exported----------------")
        elif(export_format == "xlsx"):
            self.collision_r.to_excel(filename)
            print("----------------collision right data is successfully exported-------------")
            self.collision_l.to_excel(filename2)
            print("---------------collision left data is successfully exported----------------")

class Writer2:
    """recive a list of lists"""
    def __init__(self, dataList: List):
        self.location: pd.DataFrame = self._convert_to_dataframe(dataList)
    def _convert_to_dataframe(self, data: List) -> pd.DataFrame:
        """takes a list of lists and transforms it to a dataframe """
        return pd.DataFrame(data, index=[x for x in range(len(data))])
    def export_dataframe(self, filename: str, export_format: str = "", mode: str ="w") -> None:
        """takes several arguments incl. data which is just the instance class defined obove"""
        if(export_format == "csv"):
            self.location.to_csv(filename, mode=mode, float_format='%.2f')
            print("---------------location data is successfully exported----------------")
        elif(export_format == "xlsx"):
            self.location.to_excel(filename)
            print("---------------location data is successfully exported----------------")

